import React , { Component } from 'react';
import { Bar, Line, Pie} from 'react-chartjs-2';

class DemographicsData extends Component {
    constructor(props) {
        super(props);
        this.state = {
            ChartData: {
                labels: ['Boston', 'Worcester', 'springField', 'Lowell', 'Cambridge', 'new'],
                datasets: [
                    {
                        label: 'Population',
                        data: [
                            461759,
                            181045,
                            457878,
                            568942,
                            787878,
                            451543,
                            784521
                        ],
                        backgroundColor: [
                            '#03a9f4',
                            '#03a9f4'
                            // 'rgba(255, 99, 132, 0.6)',
                            // 'rgba(255, 99, 132, 0.6)',
                            // 'rgba(255, 99, 132, 0.6)',
                            // 'rgba(255, 99, 132, 0.6)',
                            // 'rgba(255, 99, 132, 0.6)',
                            // 'rgba(255, 99, 132, 0.6)'
                            
                        ]
                    }
                ]
            }
        }
    }

    render() {
        return (
            <div className="Chart-Bar">
                <Bar
                    data={this.state.ChartData}
                    options={{
                        maintainAspectRatio: false
                    }}
                />
            </div>
        )
    }
} 
export default DemographicsData;
